import React from 'react';
import logo from './logo.svg';
import './App.css';
import SupportApplication from './web/pages/welcome';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <div className=''>
        <SupportApplication message="hi mark"></SupportApplication>
      </div>
    </div>
  );
}

export default App;
